import React, { Component } from 'react';


class Nav extends Component {
    render() { 

        const navStyle = {
            display: 'flex',
            alignItems: 'flex-end',
            minHeight: '100px',
            backgroundColor: '#FFFFFFF',
            borderBottom: '20px #E1C3C7 solid',
            padding: '0px 20px',
            paddingBottom: '34px'
        }

        const secondAlign = {
            display: 'flex'
        }

        const navItems = {
            listStyleType: 'none',
            fontFamily: 'avenir'
        }

        const logo = {
            width: '135px',
            height: '35px'
        }

        return(
            <nav style={navStyle}>
                <spam style={secondAlign}>
                    <img style={logo} src='./images/logo.png' />
                    <ul style={navItems}>
                        <li>Merchant Portal</li>
                    </ul>
                </spam>
            </nav>
        );
    }
}

export default Nav;
